	/**
	 * 新增代理商
	 * 
	 * @param vendorId
	 * @param agentFid
	 * @param productId
	 * @param agentTel
	 * @param agentEmaill
	 * @param agentAddress
	 * @param business_licence
	 * @param agent_authorize
	 * @param agentLevel
	 * @param mark
	 * @return
	 */
	@RequestMapping("/ADD/agent/addAgentInfo.do")
	@ResponseBody
	public JSONObject addAgentInfo(Integer vendorId, String agentName,
			Integer agentFid, Integer productId, String agentTel,
			String agentEmaill, String agentAddress, String business_licence,
			String agent_authorize, Integer agentLevel, String mark) {
		JSONObject result = new JSONObject();
		AgentEntity entity = new AgentEntity();

		entity.setVendorId(vendorId);
		entity.setAgentName(agentName);
		entity.setAgentFid(agentFid);
		entity.setProductId(productId);
		entity.setAgentTel(agentTel);
		entity.setAgentEmaill(agentEmaill);
		entity.setAgentAddress(agentAddress);
		entity.setBusinessLicence(business_licence);
		entity.setAgentAuthorize(agent_authorize);
		entity.setAgentLevel(agentLevel);
		entity.setMark(mark);

		int temp = service.addAgentInfo(entity);
		if (temp > 0) {
			result.put("status", 1);
			result.put("msg", "成功");
		} else {
			result.put("status", -2);
			result.put("msg", "新增失敗");
		}
		return result;
	}

