	/**
	 * 删除代理网点及子孙代理
	 * 
	 * @param id
	 * @return
	 */
	@RequestMapping("/DELETE/agent/deleteAgentNode.do")
	@ResponseBody
	public JSONObject deleteAgentNode(Integer vendorId,Integer id) {
		JSONObject result = new JSONObject();
		String AgentId = id.toString();
		//查询所有的代理
		TreeNode<AgentEntity> entities = service.getAgentTree(vendorId);
		TreeNode<AgentEntity> treeNode=new TreeNode<AgentEntity>();
		//获取某个节点及其子孙节点
		List<TreeNode<AgentEntity>> nodes = treeNode.getTreeNode(entities, AgentId);
		
		if (nodes.size()>1) {
			//遍历删除节点及其子孙节点
			for (TreeNode<AgentEntity> treeNode2 : nodes) {
				int temp = service.deleteAgentNode(Integer.parseInt(treeNode2.getId()));
				//删除代理商时顺便一起删除代理商的员工
				int temp1 = empService.deleteAgentEmpById(Integer.parseInt(treeNode2.getId()));
				
				if (temp1 > 0) {
					log.debug("删除"+treeNode2.getName()+"员工成功！");
				}
				
				if (temp > 0) {
					result.put("status", 1);
					result.put("msg", "删除"+treeNode2.getName()+"成功");
				} else {
					result.put("status", -2);
					result.put("msg", "删除"+treeNode2.getName()+"失败");
				}
				
			}
			
		}else{
			int temp = service.deleteAgentNode(id);
			//删除代理商时顺便一起删除代理商的员工
			int temp1 = empService.deleteAgentEmpById(id);
			if (temp > 0) {
				
				if (temp1 > 0) {
					result.put("delEmp", "删除员工成功！");
				}
				
				result.put("msg", "删除成功");
				result.put("status", 1);
			} else {
				result.put("status", -2);
				result.put("msg", "删除失败");
			}
		}
		
		
		return result;
	}

