	/**
	 * 根据某一节点的代理商ID获取当前代理商及其所有的子孙节点的信息
	 * 
	 * @param id
	 * @param vendorId
	 * @return
	 */
	@RequestMapping("/GET/agent/getAgentInfoByNodeId.do")
	@ResponseBody
	public JSONObject getAgentInfoByNodeId(HttpServletResponse response, Integer id,
			Integer vendorId) {
		JSONObject result = new JSONObject();
		JSONArray array = new JSONArray();
		String AgentId = id.toString();
		TreeNode<AgentEntity> entities = service.getAgentTree(vendorId);
		TreeNode<AgentEntity> treeNode=new TreeNode<AgentEntity>();
		List<TreeNode<AgentEntity>> nodes = treeNode.getTreeNode(entities, AgentId);

		for (TreeNode<AgentEntity> treeNode2 : nodes) {
			JSONObject obj=new JSONObject();
			obj.put("noData", treeNode2.getNodeData());
			array.add(obj);
		}

		result.put("data", array);
		
		return result;
	}
	
	/**
	 * 根据代理商id查询某个代理商的信息
	 * @param id
	 * @return
	 */
	@RequestMapping("/GET/agent/getAgentInfoById.do")
	@ResponseBody
	public JSONObject getAgentInfoById(Integer id){
		JSONObject result=new JSONObject();
		AgentEntity entity=service.getAgentInfoById(id);
		if (entity !=null) {
			result.put("id", entity.getId());
			result.put("agentName", entity.getAgentName());
			result.put("vendorId", entity.getVendorId());
			result.put("agentFid", entity.getAgentFid());
			result.put("productId", entity.getProductId());
			result.put("agentTel", entity.getAgentTel());
			result.put("agentEmaill", entity.getAgentEmaill());
			result.put("agentAddress", entity.getAgentAddress());
			result.put("business_licence", entity.getBusinessLicence());
			result.put("agent_authorize", entity.getAgentAuthorize());
			result.put("agentLevel", entity.getAgentLevel());
			result.put("agentFirstChilId", entity.getAgentFirstChilId());
			result.put("broAgentId", entity.getBroAgentId());
			result.put("mark", entity.getMark());
		}
		
		return result;
	}
	
