	/**
	 * 获取代理商授权码信息
	 * @param agentId
	 * @return
	 */
	@RequestMapping("/GET/agent/getAgentLogisticCode.do")
	@ResponseBody
	public JSONObject getAgentLogisticCode(Integer agentId){
		JSONObject result = new JSONObject();
		LogisticCode code=service.getAgentLogisticCode(agentId);
		
		if (code !=null) {
			result.put("logisticId", code.getLogisticId());
			result.put("vendorId", code.getVendorId());
			result.put("productId", code.getProductId());
			result.put("agentId", code.getAgentId());
			result.put("logisticCode", code.getLogisticCode());
			result.put("createTime", code.getCreateTime());
			result.put("status", code.getStatus());
			result.put("lvCount", code.getLvCount());
		}else{
			result.put("msg", "获取二维码失败！");
		}
		
		return result;
	}
	
