	/**
	 * 根据某个代理商id获取其所有子孙代理商列表数据
	 * @param agentId
	 * @return
	 */
	@RequestMapping("/GET/agent/getlist.do")
	@ResponseBody
	public JSONObject getlist(Integer agentId){
		List<AgentEntity> entity= service.getAllParentTreeNodeByChildForList(agentId);
		JSONObject result=new JSONObject();
		JSONArray array=new JSONArray();
		for (AgentEntity agentEntity : entity) {
			JSONObject obj=new JSONObject();
			obj.put("agentName", agentEntity.getAgentName());
			array.add(obj);
		}
		result.put("data", array);
		return result;
	}
	
