	/**
	 * 获取省份中的城市的地图
	 * @param response
	 * @param NameOrCode
	 * @return
	 */
	@RequestMapping("/GET/agent/getCityData.do")
	@ResponseBody
	public String getCityData(HttpServletResponse response,String NameOrCode){
		String result="";
		String pathTest;
		FileInputStream fis=null;
		OutputStream out = null;
		
		try {
			pathTest = getClass().getResource("/").toURI().getPath();
			String path = pathTest.substring(0,pathTest.lastIndexOf("webapps") + 7);
			String content = "/province/"+NameOrCode+".json";
			String realPath = path + content;
			fis=new FileInputStream(realPath);
			
			int i=fis.available(); //得到文件大小
			byte data[]=new byte[i];
			fis.read(data); //读数据
//			read=new InputStreamReader(fis, "UTF-8");
//	
//			br= new BufferedReader(read);// 读取原始json文件
//			String str=null;
//			
//			while ((str=br.readLine())!=null) {
//				result+=str;
//			}
			
			// 输出JSON数据
			// 这里直接通过response输出JSON字符串
			// Spring MVC也提供了输出JSON数据的方法

			// 设置编码格式
			response.setContentType("text/plain;charset=utf-8");
			response.setCharacterEncoding("utf-8");

			out = response.getOutputStream();
			out.write(data);
			out.flush();
			
			

			return result;

		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		} finally {
			try {

				if (fis != null) {

					fis.close();
				}
				
				if (out != null) {
					out.close();
				}
				
			} catch (IOException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}

		}
		return result;
		
	}
	
